package tcs.app.dev.excercise.viewmodel.data

import android.graphics.Bitmap
import android.graphics.BitmapFactory
import kotlinx.coroutines.delay
import kotlin.Result.Companion.failure
import kotlin.Result.Companion.success
import android.util.Base64
import kotlin.time.Duration.Companion.milliseconds
import kotlin.time.Duration.Companion.seconds

data class Option(
    val id: String,
    val title: String,
    val description: String,
    val previewImage: Bitmap? = null
)

data class NotFound(override val message: String) : Exception(message)

suspend fun getOptions(): Result<List<Option>> {
    delay(50.milliseconds)

    return success(
        listOf(
            Option("LMU", LMUTitle, LMUDescription),
            Option("TUM", TUMTitle, TUMDescription)
        )
    )
}

suspend fun getPreviewImage(id: String): Result<Bitmap> {
    delay(700.milliseconds)

    val imageNotFound: Result<Bitmap> = failure(NotFound("Image not found!"))

    val image = when (id) {
        "LMU" -> {
            delay(500.milliseconds)
            decodeBase64ToBitmap(LMUImage)
        }
        "TUM" -> {
            decodeBase64ToBitmap(TUMImage)
        }
        else -> return imageNotFound
    }

    return if (image != null) success(image) else imageNotFound
}

suspend fun getImage(id: String): Result<Bitmap> {
    delay(1.seconds)

    val imageNotFound: Result<Bitmap> = failure(NotFound("Image not found!"))

    if (loadingAttempts < 3) {
        loadingAttempts++
        return imageNotFound
    }

    val image = when (id) {
        "LMU" -> decodeBase64ToBitmap(LMUImage)
        "TUM" -> decodeBase64ToBitmap(TUMImage)
        else -> return imageNotFound
    }

    return if (image != null) success(image) else imageNotFound
}

private var loadingAttempts = 0

private fun decodeBase64ToBitmap(base64: String): Bitmap? {
    val bytes = Base64.decode(base64, Base64.DEFAULT)
    return BitmapFactory.decodeByteArray(bytes, 0, bytes.size)
}

private const val LMUTitle = "Ludwig-Maximilians-Universität"

private const val TUMTitle = "Technische Universität München"

private const val LMUDescription =
    "Die LMU gehört zu den forschungsstärksten Universitäten Europas. Mit ihrem ausdifferenzierten Fächerspektrum verfügt sie über ein herausragendes Potenzial für zukunftsweisende Forschung."

private const val TUMDescription =
    "Durch verantwortungsvolle Forschung, vertrauenswürdige Innovationen und weitblickende Lehr- und Weiterbildungskonzepte gestalten wir eine nachhaltige Zukunft."

@Suppress("MayBeConstant")
private val LMUImage =
    ""
@Suppress("MayBeConstant")
private val TUMImage =
    ""
